,p_plug_name=>'welcome_txt'
,p_title=>'Bem-vindo(a) ao EsFa'
,p_region_template_options=>'#DEFAULT#:t-Region--removeHeader js-removeLandmark:t-Region--scrollBody'
,p_plug_template=>wwv_flow_imp.id(220964005915371759)
,p_plug_display_sequence=>10
,p_plug_grid_column_span=>9
,p_location=>null
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'<div style="font-family: Arial, sans-serif; max-width: 900px; margin: auto; line-height: 1.6;">',
'',
'  <h2>Bem-vindo ao SeFa</h2>',
'',
'  <p>',
unistr('    A Plataforma SeFa - Sistema Esfor\00E7o Faturamento, foi concebida como solu\00E7\00E3o centralizadora, rastreadora e automatizadora '),
unistr('    para o registro de atividades realizadas pelo Prestador de Servi\00E7os em contratos firmados com os Clientes da organiza\00E7\00E3o. '),
unistr('    Ela busca atender \00E0 crescente demanda por maior rastreabilidade, visibilidade e documenta\00E7\00E3o formal das atividades registradas, '),
unistr('    especialmente em um cen\00E1rio onde m\00FAltiplos sistemas de chamados coexistem (internos, de fornecedores e de clientes), '),
unistr('    e a interoperabilidade entre eles \00E9 limitada.'),
'  </p>',
'',
unistr('  <p>A cria\00E7\00E3o do SeFa se justifica por tr\00EAs principais fatores:</p>'),
'  <ul>',
unistr('    <li>O sistema anterior de demandas era uma adapta\00E7\00E3o, com manuten\00E7\00E3o e fluxo complexos, onde v\00E1rias pessoas atuaram sem documenta\00E7\00E3o.</li>'),
unistr('    <li>automatiza\00E7\00E3o de processos que antes eram feitos por uma planilha e necessitavam de moderniza\00E7\00E3o.</li>'),
unistr('    <li>A exig\00EAncia dos clientes para comprova\00E7\00E3o efetiva das atividades realizadas diariamente por seus prestadores, a fim de validar faturas mensais e evitar cobran\00E7as indevidas.</li>'),
'  </ul>',
'',
'  <p>',
unistr('    O SeFa busca padronizar e consolidar os registros de demandas, esfor\00E7os di\00E1rios e rastreamento entre sistemas, '),
unistr('    fornecendo tamb\00E9m relat\00F3rios gerenciais para apoiar decis\00F5es estrat\00E9gicas.'),
'  </p>',
'',
unistr('  <p><strong>Selecione um item no menu \00E0 esquerda para come\00E7ar!</strong></p>'),
'',
'</div>'))
,p_attributes=>wwv_flow_t_plugin_attributes(wwv_flow_t_varchar2(
  'expand_shortcuts', 'N',
  'output_as', 'HTML')).to_clob
);
