,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'<div style="background-color: #e7f3fe; border-left: 4px solid #0070C0; padding: 15px; border-radius: 6px; font-family: Arial, sans-serif; color: #333;">',
'  <div style="display: flex; align-items: center; margin-bottom: 10px;">',
'    <i class="fa fa-file-edit" style="font-size: 22px; color: #0070C0; margin-right: 8px;"></i>',
'    <h3 style="margin: 0; font-size: 18px;">',
unistr('      <a href="#" style="color: #0070C0; text-decoration: none;">TPI - Tabela de Pre\00E7o Insumo</a>'),
'    </h3>',
'  </div>',
'  <p>',
unistr('      A TPI - Tabela de Pre\00E7o de Insumo deve ser cadastrada ou carregada na plataforma somente ap\00F3s a publica\00E7\00E3o oficial do documento em canais p\00FAblicos (site da empresa, di\00E1rio oficial, etc.), garantindo acesso a todos os envolvidos (clientes, forne')
||'cedores).',
'    </p><br>',
'    <p>',
unistr('      Os itens da tabela devem estar normalizados. Caso um item de n\00EDvel inferior tenha a mesma descri\00E7\00E3o de outro em n\00EDvel superior (ou vice-versa), \00E9 necess\00E1rio complementar a descri\00E7\00E3o com o n\00EDvel correspondente, evitando duplicidades e garantindo')
||' clareza para todos que utilizam os dados.',
'    </p>',
'<br><br>',
'  ',
'  <div style="background-color: #d9edf7; border-radius: 4px; padding: 10px; margin-top: 15px; border: 1px solid #bce8f1;">',
unistr('    <strong>Dica:</strong>Somente itens com valores ser\00E3o listados na plataforma. Antes de cadastrar ou carregar dados, fa\00E7a uma verifica\00E7\00E3o geral e normalize os itens, garantindo que n\00E3o existam duplicidades de descri\00E7\00E3o com valores diferentes e pre')
||unistr('venindo inconsist\00EAncias.'),
'  </div>',
'</div>',
''))
