,p_process_name=>'associa Colaborador a filial'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'',
'v_count        NUMBER;',
'v_colb_sq      NUMBER;',
'begin',
'',
'SELECT count(*)',
'into   v_count',
'FROM   cad_colb_x_fili',
'WHERE instr(:P26_COLB_SQ,'':'' || COXFI_COLB_SQ || '':'') > 0;',
'',
'IF v_count > 0 THEN',
'',
'update cad_colb_x_fili set COXFI_CLIF_SQ = :P26_COXFI_CLIF_SQ',
'                         --  COXFI_CARGO_COLB = :P26_COXFI_CARGO_COLB,',
'                    --       COXFI_STATUS     = :P26_COXFI_STATUS',
'where  instr(:P26_COLB_SQ,'':'' || COXFI_COLB_SQ || '':'') > 0;',
'',
unistr('ELSE  -- \00C9 UM REGISTRO NOVO'),
'',
'-- Extrai o primeiro valor entre os dois pontos',
'  v_colb_sq := REGEXP_SUBSTR(:P26_COLB_SQ, ''[0-9]+'', 1, 1);',
'',
'INSERT INTO cad_colb_x_fili (COXFI_COLB_SQ, COXFI_CLIF_SQ)',
'VALUES (v_colb_sq,:P26_COXFI_CLIF_SQ);',
'',
'END IF;',
'end;'))
