wwv_flow_imp_page.create_page_plug(
 p_id=>wwv_flow_imp.id(239753911444490062)
,p_plug_name=>'IG - Consumo por Perfil'
,p_region_name=>'grid_atividade'
,p_parent_plug_id=>wwv_flow_imp.id(160536899324569668)
,p_region_template_options=>'#DEFAULT#'
,p_plug_template=>wwv_flow_imp.id(220954202314371752)
,p_plug_display_sequence=>10
,p_plug_display_point=>'SUB_REGIONS'
,p_query_type=>'SQL'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'SELECT',
'    p.PEXCO_SQ,',
'    p.PEXCO_COXFI_SQ,',
'    colb.COLB_NOME,',
'    clif.CLIF_CD || '' - '' || clif.CLIF_DESC AS unidade,',
'    esp.espe_sq,',
'    esp.espe_cd || '': '' || esp.espe_desc AS espe,',
'    p.PEXCO_ESXIN_SQ,',
'    ESXIN.ESXIN_CD_ALIAS || '' '' || ESXIN.ESXIN_DESC_ALIAS AS INSUMO,',
'    p.PEXCO_QTDE_HORAS_MES,',
'',
unistr('    -- Horas consumidas no m\00EAs selecionado'),
'    (',
'        SELECT NVL(SUM(EXTRACT(HOUR FROM ESFO.ESFO_HORA)), 0)',
'        FROM NEGOCIO.NEG_ESFORCO_FATURAMENTO ESFO',
'        WHERE ESFO.ESFO_ESXIN_SQ = p.PEXCO_ESXIN_SQ',
'          AND ESFO.ESFO_COXFI_SQ = p.PEXCO_COXFI_SQ',
'          AND (',
'              :P29_MES_COMPETENCIA IS NULL',
'              OR TO_CHAR(ESFO.ESFO_DATA, ''MM/YYYY'') = :P29_MES_COMPETENCIA',
'          )',
'    ) || ''h'' AS horas_consumida,',
'',
'    -- Saldo de horas',
'    (',
'        p.PEXCO_QTDE_HORAS_MES -',
'        NVL((',
'            SELECT SUM(EXTRACT(HOUR FROM ESFO.ESFO_HORA))',
'            FROM NEGOCIO.NEG_ESFORCO_FATURAMENTO ESFO',
'            WHERE ESFO.ESFO_ESXIN_SQ = p.PEXCO_ESXIN_SQ',
'              AND ESFO.ESFO_COXFI_SQ = p.PEXCO_COXFI_SQ',
'              AND (',
'                  :P29_MES_COMPETENCIA IS NULL',
'                  OR TO_CHAR(ESFO.ESFO_DATA, ''MM/YYYY'') = :P29_MES_COMPETENCIA',
'              )',
'        ), 0)',
'    ) || ''h'' AS saldo_horas',
'',
'FROM',
'    cadastro.cad_perfil_colaborador p',
'    INNER JOIN cadastro.cad_colb_x_fili coxfi ON p.pexco_coxfi_sq = coxfi.coxfi_sq',
'    INNER JOIN cadastro.cad_colaborador colb ON coxfi.coxfi_colb_sq = colb.colb_sq',
'    INNER JOIN cadastro.cad_espe_x_insu esxin ON p.pexco_esxin_sq = esxin.esxin_sq',
'    INNER JOIN cadastro.cad_especificacao esp ON esxin.esxin_espe_sq = esp.espe_sq',
'    INNER JOIN cadastro.cad_cliente_filial clif ON coxfi.coxfi_clif_sq = clif.clif_sq',
''))
,p_plug_source_type=>'NATIVE_IR'
,p_ajax_items_to_submit=>'P29_MES_COMPETENCIA'
,p_prn_content_disposition=>'ATTACHMENT'
,p_prn_units=>'MILLIMETERS'
,p_prn_paper_size=>'A4'
