wwv_flow_imp_page.create_page_process(
 p_id=>wwv_flow_imp.id(161513968999610647)
,p_process_sequence=>10
,p_process_point=>'AFTER_SUBMIT'
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'Exporta Consumo x Perfil'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'    l_ctx       apex_exec.t_context;',
'',
'    l_export    apex_data_export.t_export;',
'    l_column_groups         apex_data_export.t_column_groups;',
'    l_columns               apex_data_export.t_columns;',
'',
'    -- Column group indexes',
'    l_consuPerfil_idx          pls_integer;',
' --   l_consuAtividade_idx      pls_integer;',
'BEGIN',
'    -- 1) Gera XLSX da aba "Consumo por Perfil"',
'    l_ctx := apex_exec.open_query_context(',
'        p_location  => apex_exec.c_location_local_db,',
'        p_sql_query => ''',
'            SELECT',
'                colb.COLB_NOME AS colaborador,',
'                esp.espe_cd || '''':'''' || esp.espe_desc AS espe,',
'                ESXIN.ESXIN_CD_ALIAS || '''' '''' || ESXIN.ESXIN_DESC_ALIAS AS INSUMO,',
'                p.PEXCO_QTDE_HORAS_MES AS TOTAL_HORAS,',
unistr('                ( -- Horas consumidas no m\00EAs selecionado'),
'                  SELECT NVL(SUM(EXTRACT(HOUR FROM ESFO.ESFO_HORA)), 0)',
'                  FROM NEGOCIO.NEG_ESFORCO_FATURAMENTO ESFO',
'                  WHERE ESFO.ESFO_ESXIN_SQ = p.PEXCO_ESXIN_SQ',
'                    AND ESFO.ESFO_COXFI_SQ = p.PEXCO_COXFI_SQ',
'                    AND (',
'                        :P29_MES_COMPETENCIA IS NULL',
'                        OR TO_CHAR(ESFO.ESFO_DATA, ''''MM/YYYY'''') = :P29_MES_COMPETENCIA',
'                    )',
'                )  AS horas_consumidas,',
'                (',
'                  p.PEXCO_QTDE_HORAS_MES -',
'                  NVL(',
'                    (',
'                      SELECT SUM(EXTRACT(HOUR FROM ESFO.ESFO_HORA))',
'                      FROM NEGOCIO.NEG_ESFORCO_FATURAMENTO ESFO',
'                      WHERE ESFO.ESFO_ESXIN_SQ = p.PEXCO_ESXIN_SQ',
'                        AND ESFO.ESFO_COXFI_SQ = p.PEXCO_COXFI_SQ',
'                        AND (',
'                            :P29_MES_COMPETENCIA IS NULL',
'                            OR TO_CHAR(ESFO.ESFO_DATA, ''''MM/YYYY'''') = :P29_MES_COMPETENCIA',
'                        )',
'                    ), 0',
'                  )',
'                )  AS saldo_horas',
'            FROM',
'                cadastro.cad_perfil_colaborador p',
'                INNER JOIN cadastro.cad_colb_x_fili coxfi ON p.pexco_coxfi_sq = coxfi.coxfi_sq',
'                INNER JOIN cadastro.cad_colaborador colb ON coxfi.coxfi_colb_sq = colb.colb_sq',
'                INNER JOIN cadastro.cad_espe_x_insu esxin ON p.pexco_esxin_sq = esxin.esxin_sq',
'                INNER JOIN cadastro.cad_especificacao esp ON esxin.esxin_espe_sq = esp.espe_sq',
'                INNER JOIN cadastro.cad_cliente_filial clif ON coxfi.coxfi_clif_sq = clif.clif_sq',
'                LEFT JOIN cadastro.cad_espe_x_insu ESXIN ON p.pexco_esxin_sq = ESXIN.ESXIN_SQ''   );',
'    ',
'     -- Define column groups',
'    apex_data_export.add_column_group(',
'        p_column_groups   => l_column_groups,',
'        p_idx             => l_consuPerfil_idx,',
'        p_name            => ''Consumo Por Perfil'' );',
'',
'     -- Define columns',
'    apex_data_export.add_column(',
'        p_columns             => l_columns,',
'        p_name                => ''COLABORADOR'',',
'        p_heading             => ''Colaborador'',',
'        p_heading_alignment   => ''CENTER'',',
'        p_column_group_idx    => l_consuPerfil_idx );    ',
'',
'    apex_data_export.add_column(',
'        p_columns             => l_columns,',
'        p_name                => ''ESPE'',',
unistr('        p_heading             => ''Especifica\00E7\00E3o'','),
'        p_heading_alignment   => ''CENTER'',',
'        p_column_group_idx    => l_consuPerfil_idx ); ',
'',
'',
'    apex_data_export.add_column(',
'        p_columns             => l_columns,',
'        p_name                => ''INSUMO'',',
'        p_heading             => ''Insumo'',',
'        p_heading_alignment   => ''CENTER'',',
'        p_column_group_idx    => l_consuPerfil_idx ); ',
'',
'    apex_data_export.add_column(',
'        p_columns             => l_columns,',
'        p_name                => ''TOTAL_HORAS'',',
'        p_heading             => ''Total Horas'',',
'        p_heading_alignment   => ''CENTER'',',
'        p_value_alignment     => ''CENTER'',',
'        p_column_group_idx    => l_consuPerfil_idx ); ',
'',
'    apex_data_export.add_column(',
'        p_columns             => l_columns,',
'        p_name                => ''HORAS_CONSUMIDAS'',',
'        p_heading             => ''Horas Consumidas'',',
'        p_heading_alignment   => ''CENTER'',',
'        p_value_alignment     => ''CENTER'',',
'        p_column_group_idx    => l_consuPerfil_idx );          ',
'',
'        apex_data_export.add_column(',
'        p_columns             => l_columns,',
'        p_name                => ''SALDO_HORAS'',',
'        p_heading             => ''Saldo'',',
'        p_heading_alignment   => ''CENTER'',',
'        p_value_alignment     => ''CENTER'',',
'        p_column_group_idx    => l_consuPerfil_idx );              ',
'',
'    l_export := apex_data_export.export(',
'        p_context               => l_ctx,',
'        p_format                => apex_data_export.c_format_xlsx,',
'        p_columns               => l_columns,',
'        p_column_groups         => l_column_groups,',
'        p_file_name => ''Consumo_por_perfil.xlsx''',
'    );',
'',
'    apex_exec.close(l_ctx);',
'',
'    apex_data_export.download( p_export => l_export );',
'    ',
'EXCEPTION',
'    WHEN OTHERS THEN',
'    apex_exec.close(l_ctx);',
'    raise;',
'END;'))
,p_process_clob_language=>'PLSQL'
,p_process_error_message=>'Houve um erro ao gerar o arquivo!'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_when_button_id=>wwv_flow_imp.id(161471499594405906)
,p_process_success_message=>'Arquivo gerado com sucesso!'
,p_internal_uid=>79305887840910305
);
wwv_flow_imp_page.create_page_process(
 p_id=>wwv_flow_imp.id(161516620019610674)
,p_process_sequence=>20
,p_process_point=>'AFTER_SUBMIT'
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'Exporta Consumo x Atividade'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'    l_ctx       apex_exec.t_context;',
'',
'    l_export    apex_data_export.t_export;',
'    l_column_groups         apex_data_export.t_column_groups;',
'    l_columns               apex_data_export.t_columns;',
'',
'    -- Column group indexes',
'    l_consuAtividade_idx      pls_integer;',
'    l_sisOtrs_idx      pls_integer;',
'    l_sisItsm_idx      pls_integer;',
'BEGIN',
'    -- 1) Gera XLSX da aba "Consumo por Atividade"',
'    l_ctx := apex_exec.open_query_context(',
'        p_location  => apex_exec.c_location_local_db,',
'        p_sql_query => ',
'   ''SELECT COLB.COLB_NOME AS COLABORADOR,',
'    ESP.ESPE_CD AS ESPE,',
'    INSU.INSU_CD ||'''' ''''  || INSU.INSU_DESC AS INSUMO,',
'    TO_CHAR(ESFO.ESFO_DATA, ''''DD/MM/YYYY'''') AS ESFO_DATA,',
'    REGEXP_REPLACE(TO_CHAR(ESFO_HORA), ''''^\+0\s*|\.0+$'''', '''''''') AS ESFO_HORA,',
'    ESXIN.ESXIN_VLR_UNITARIO_ESP VALOR_HORA,',
'    ROUND( ((EXTRACT(HOUR FROM ESFO.ESFO_HORA) + (EXTRACT(MINUTE FROM ESFO.ESFO_HORA) / 60))  ) * ESXIN.ESXIN_VLR_UNITARIO_ESP, 2) AS VALOR_DIA,',
'    ESFO.ESFO_NR_REQUISICAO,',
'    PROD.PROD_NOME AS SISTEMA,',
'    CTGO.CTGO_DESC AS CATEGORIA,',
'    TPAT.TPAT_DESC AS TIPO_ATIVIDADE,',
'    ESFO.ESFO_DESC_ATIVIDADE AS DESCRICAO,',
'',
'	--- SISTEMA OTRS',
'	OTRS.OTRS_TICKET,',
'    OTRS.OTRS_TITULO,',
'	OTRS.OTRS_DT_CRIADO,',
'	OTRS.OTRS_HR_FECHAMENTO,',
'	OTRS.OTRS_FILA,',
'	OTRS.OTRS_ESTADO,',
'	OTRS.OTRS_PRIORIDADE,',
'	OTRS.OTRS_ID_CLIENTE,',
'	OTRS.OTRS_SERVICO,',
'	OTRS.OTRS_SLA,',
'	OTRS.OTRS_TIPO,',
'	OTRS.OTRS_ATENDENTE_PROPRIETARIO,',
'    OTRS.OTRS_ESCALATION_DESTINATION_IN,',
'    OTRS.OTRS_ESCALATION_DESTINATION_DT,',
'    OTRS.OTRS_PRIMEIRA_RESP_MIN,',
'    OTRS.OTRS_SOLUTION_TIME,',
'    OTRS.OTRS_TEMPO_SOL_MIN,',
'    OTRS.OTRS_DELTA_TEMP_SOL_MIN,',
'    OTRS.OTRS_DECISAO_RESULTANTE,',
'    OTRS.OTRS_DT_DECISAO,',
'    OTRS.OTRS_SISTEMAS,',
'    OTRS.OTRS_VALOR_PRECIFICACAO,',
'	',
'	--- SISTEMA ITSM',
'    ITSM.ITSM_ID_SOLICITACAO,',
'    ITSM.ITSM_ID_INCIDENTE,',
'    ITSM.ITSM_STATUS,',
'    ITSM.ITSM_NOTAS,',
'    ITSM.ITSM_ORGANIZACAO,',
'    ITSM.ITSM_DT_ABERTURA,',
'    ITSM.ITSM_DT_ULT_RESOLUCAO,',
'    ITSM.ITSM_SUMARIO,',
'    ITSM.ITSM_RESOLUCAO,',
'    ITSM.ITSM_GRUPO_DESIGNADO',
'        FROM',
'    NEGOCIO.NEG_ESFORCO_FATURAMENTO ESFO',
'	INNER JOIN CADASTRO.CAD_PERFIL_COLABORADOR PEXCO ON ESFO.ESFO_COXFI_SQ = PEXCO.PEXCO_COXFI_SQ ',
'    INNER JOIN cadastro.cad_colb_x_fili coxfi ON PEXCO.pexco_coxfi_sq = coxfi.coxfi_sq',
'    INNER JOIN cadastro.cad_colaborador colb ON coxfi.coxfi_colb_sq = colb.colb_sq',
'    INNER JOIN CADASTRO.CAD_ESPE_X_INSU ESXIN ON ESFO.ESFO_ESXIN_SQ = ESXIN.ESXIN_SQ',
'    INNER JOIN CADASTRO.CAD_ESPECIFICACAO ESP ON ESXIN.ESXIN_ESPE_SQ = ESP.ESPE_SQ',
'    INNER JOIN CADASTRO.CAD_ESPE_X_PROD ESXPR ON ESFO.ESFO_ESXPR_SQ = ESXPR.ESXPR_SQ',
'    INNER JOIN CADASTRO.CAD_PRODUTO PROD ON ESXPR.ESXPR_PROD_SQ = PROD.PROD_SQ',
'    INNER JOIN CADASTRO.CAD_TPAT_X_CTGO TPXCT ON ESFO.ESFO_TPXCT_SQ = TPXCT.TPXCT_SQ',
'    INNER JOIN CADASTRO.CAD_CATEGORIA CTGO ON TPXCT.TPXCT_CTGO_SQ = CTGO.CTGO_SQ',
'    INNER JOIN CADASTRO.CAD_TIPO_ATIVIDADE TPAT ON TPXCT.TPXCT_TPAT_SQ = TPAT.TPAT_SQ',
'    INNER JOIN CADASTRO.CAD_INSUMO INSU ON ESXIN.ESXIN_INSU_SQ = INSU.INSU_SQ',
'    LEFT JOIN CARGA.CAR_ITSM ITSM ON ESFO.ESFO_NR_REQUISICAO = ITSM.ITSM_ID_SOLICITACAO',
'    LEFT JOIN CARGA.CAR_OTRS OTRS ON ESFO.ESFO_NR_REQUISICAO = OTRS.OTRS_TICKET',
'	WHERE',
'    (:P29_MES_COMPETENCIA IS NULL OR TO_CHAR(ESFO.ESFO_DATA, ''''MM/YYYY'''') = :P29_MES_COMPETENCIA)''   ',
'    );',
'    ',
'     -- Define column groups',
'    apex_data_export.add_column_group(',
'        p_column_groups   => l_column_groups,',
'        p_idx             => l_consuAtividade_idx,',
unistr('        p_name            => ''Consumo Por Atividade - Dados Lan\00E7ados pelo Esfor\00E7o'' );'),
'',
'    apex_data_export.add_column_group(',
'        p_column_groups   => l_column_groups,',
'        p_idx             => l_sisOtrs_idx,',
'        p_name            => ''Sistema OTRS - Dados Fornecidos pela SES'' );',
'',
'    apex_data_export.add_column_group(',
'        p_column_groups   => l_column_groups,',
'        p_idx             => l_sisItsm_idx,',
'        p_name            => ''Sistema ITSM - Dados Fornecidos pela PRODESP'' );        ',
'',
'     -- Define columns Atividade',
'    apex_data_export.add_column(',
'        p_columns             => l_columns,',
'        p_name                => ''COLABORADOR'',',
'        p_heading             => ''Colaborador'',',
'        p_heading_alignment   => ''CENTER'',',
'        p_column_group_idx    => l_consuAtividade_idx );    ',
'',
'    apex_data_export.add_column(',
