'        p_column_group_idx    => l_consuAtividade_idx ); ',
'',
'',
'    apex_data_export.add_column(',
'        p_columns             => l_columns,',
'        p_name                => ''INSUMO'',',
'        p_heading             => ''Insumo'',',
'        p_heading_alignment   => ''CENTER'',',
'        p_column_group_idx    => l_consuAtividade_idx ); ',
'',
'    apex_data_export.add_column(',
'        p_columns             => l_columns,',
'        p_name                => ''ESFO_DATA'',',
'        p_heading             => ''Data'',',
'        p_heading_alignment   => ''CENTER'',',
'        p_value_alignment     => ''CENTER'',',
'        p_column_group_idx    => l_consuAtividade_idx ); ',
'',
