,p_region_name=>'grid_atividade'
,p_parent_plug_id=>wwv_flow_imp.id(150634618794090777)
,p_region_css_classes=>'grid_atividade'
,p_region_template_options=>'#DEFAULT#'
,p_plug_template=>wwv_flow_imp.id(220954202314371752)
,p_plug_display_sequence=>10
,p_plug_new_grid_row=>false
,p_plug_grid_column_css_classes=>'grid_atividade'
,p_plug_display_point=>'SUB_REGIONS'
,p_query_type=>'SQL'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'SELECT',
'    ESFO_SQ,',
'    ESFO.ESFO_COXFI_SQ,',
'    ESFO.ESFO_DATA,',
'    ESFO.ESFO_HORA,',
'    ESP.ESPE_CD,',
'    INSU.INSU_DESC,',
'    ESFO.ESFO_NR_REQUISICAO,',
'    PROD.PROD_SQ,',
'    PROD.PROD_DESC,',
'    ESXIN.ESXIN_SQ,',
'    TPXCT.TPXCT_SQ,',
'    TPXCT.TPXCT_CTGO_SQ,',
'    TPXCT.TPXCT_TPAT_SQ,',
'    CTGO.CTGO_DESC,',
'    TPAT.TPAT_DESC,',
'    ESFO.ESFO_DESC_ATIVIDADE',
'FROM',
'    NEGOCIO.NEG_ESFORCO_FATURAMENTO ESFO',
'    LEFT JOIN CADASTRO.CAD_ESPE_X_CLIE ESXCL ON ESFO.ESFO_ESXCL_SQ = ESXCL.ESXCL_SQ',
'    INNER JOIN CADASTRO.CAD_ESPE_X_INSU ESXIN ON ESFO.ESFO_ESXIN_SQ = ESXIN.ESXIN_SQ',
'    INNER JOIN CADASTRO.CAD_ESPECIFICACAO ESP ON ESXIN.ESXIN_ESPE_SQ = ESP.ESPE_SQ',
'    INNER JOIN CADASTRO.CAD_INSUMO INSU ON ESXIN.ESXIN_INSU_SQ = INSU.INSU_SQ',
'    INNER JOIN CADASTRO.CAD_ESPE_X_PROD ESXPR ON ESFO.ESFO_ESXPR_SQ = ESXPR.ESXPR_SQ',
'    INNER JOIN CADASTRO.CAD_PRODUTO PROD ON ESXPR.ESXPR_PROD_SQ = PROD.PROD_SQ',
'    INNER JOIN CADASTRO.CAD_TPAT_X_CTGO TPXCT ON ESFO.ESFO_TPXCT_SQ = TPXCT.TPXCT_SQ',
'    INNER JOIN CADASTRO.CAD_CATEGORIA CTGO ON TPXCT.TPXCT_CTGO_SQ = CTGO.CTGO_SQ',
'    INNER JOIN CADASTRO.CAD_TIPO_ATIVIDADE TPAT ON TPXCT.TPXCT_TPAT_SQ = TPAT.TPAT_SQ',
'    INNER JOIN CADASTRO.CAD_COLB_X_FILI COXFI ON ESFO.ESFO_COXFI_SQ = COXFI.COXFI_SQ',
'    INNER JOIN CADASTRO.CAD_COLABORADOR COLB ON COXFI.COXFI_COLB_SQ = COLB.COLB_SQ',
'    INNER JOIN CADASTRO.CAD_CLIENTE_FILIAL CLIF ON COXFI.COXFI_CLIF_SQ = CLIF.CLIF_SQ',
'WHERE ',
'    COLB.COLB_NOME = :APP_USER',
'AND (',
unistr('    -- SE NENHUMA DATA INFORMADA -> M\00CAS ATUAL'),
'    (:P31_DATA_INICIAL IS NULL AND :P31_DATA_FINAL IS NULL ',
'     AND ESFO.ESFO_DATA >= TRUNC(SYSDATE, ''MM'')',
'     AND ESFO.ESFO_DATA < ADD_MONTHS(TRUNC(SYSDATE, ''MM''), 1)',
'    )',
'',
'    -- SE AS DUAS DATAS INFORMADAS -> INTERVALO COMPLETO',
'    OR (:P31_DATA_INICIAL IS NOT NULL AND :P31_DATA_FINAL IS NOT NULL ',
'        AND ESFO.ESFO_DATA BETWEEN :P31_DATA_INICIAL AND :P31_DATA_FINAL',
'       )',
'     )',
unistr(' -- Filtro de ESP (checkbox group, pode ser 1 ou v\00E1rios valores)'),
'    AND (',
'        :P31_ESPE IS NULL ',
'    OR  ESP.ESPE_CD IN ',
'        (',
'        SELECT COLUMN_VALUE FROM TABLE(APEX_STRING.SPLIT(:P31_ESPE, '':''))',
'        )',
'    )'))
,p_plug_source_type=>'NATIVE_IG'
,p_ajax_items_to_submit=>'P31_DATA_INICIAL,P31_DATA_FINAL,P31_ESPE'
,p_prn_content_disposition=>'ATTACHMENT'
,p_prn_units=>'MILLIMETERS'
