'<div style="background-color: #e7f3fe; border-left: 4px solid #0070C0; padding: 15px; border-radius: 6px; font-family: Arial, sans-serif; color: #333;">',
'  <div style="display: flex; align-items: center; margin-bottom: 10px;">',
'    <i class="fa fa-file-edit" style="font-size: 22px; color: #0070C0; margin-right: 8px;"></i>',
'    <h3 style="margin: 0; font-size: 18px;">',
unistr('      <a href="#" style="color: #0070C0; text-decoration: none;">Instru\00E7\00F5es de preenchimento</a>'),
'    </h3>',
'  </div>',
'',
'  <p><strong>TIPO ATIVIDADE:</strong></p>',
'  <ul style="padding-left: 18px; margin-top: 0;">',
unistr('    <li><strong>F\00C9RIAS, FERIADO e PONTO FACULTATIVO</strong>: n\00E3o preencher "ESPECIFICA\00C7\00C3O" e "PERFIL" (deixar em branco).</li>'),
unistr('    <li><strong>EXTERNA e REUNI\00C3O</strong>: preencher "ESPECIFICA\00C7\00C3O" e "PERFIL" somente se estiverem relacionados a uma solicita\00E7\00E3o do cliente.</li>'),
unistr('    <li><strong>PRECIFICA\00C7\00C3O</strong>: deve obrigatoriamente estar atrelado a uma <strong>DEMANDA</strong> com n\00FAmero de chamado <strong>OTRS</strong>.</li>'),
'  </ul>',
'',
unistr('  <p><strong>N\00BA REQUISI\00C7\00C3O:</strong><br>'),
unistr('  Sempre que poss\00EDvel, preencher com o n\00FAmero do chamado. Priorizar <strong>OTRS</strong>, depois <strong>ITSM</strong> e, se necess\00E1rio, <strong>GLPI</strong>.</p>'),
'',
'  <p><strong>CATEGORIA:</strong><br>',
unistr('  Se for <strong>DEMANDA</strong>, \00E9 obrigat\00F3rio ter chamado <strong>OTRS</strong> e o n\00FAmero no campo "N\00BA REQUISI\00C7\00C3O".</p>'),
'',
unistr('  <p><strong>HORA(s), SISTEMAS e DESCRI\00C7\00C3O DA ATIVIDADE:</strong><br>'),
'  Preencher normalmente, como de costume.</p>',
'</div>',
''))
,p_ai_enabled=>false
,p_attributes=>wwv_flow_t_plugin_attributes(wwv_flow_t_varchar2(
