wwv_flow_imp_page.create_page_da_action(
 p_id=>wwv_flow_imp.id(151090500334153254)
,p_event_id=>wwv_flow_imp.id(151089030089153252)
,p_event_result=>'TRUE'
,p_action_sequence=>20
,p_execute_on_page_init=>'N'
,p_name=>'valida_tabela_carga'
,p_action=>'NATIVE_EXECUTE_PLSQL_CODE'
,p_attribute_01=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
unistr('    v_result   VARCHAR2(20) := ''VERMELHO''; -- padr\00E3o'),
'    v_req      VARCHAR2(100) := TRIM(:P31_ESFO_NR_REQUISICAO);',
'    v_len      NUMBER := LENGTH(TRIM(:P31_ESFO_NR_REQUISICAO));',
'    v_dummy    VARCHAR2(1);',
'BEGIN',
unistr('    -- 1) ITSM: 15 caracteres + status v\00E1lido'),
'    IF v_len = 15 THEN',
'        BEGIN',
'            SELECT ''X''',
'            INTO v_dummy',
'            FROM CARGA.CAR_ITSM',
'            WHERE (ITSM_ID_SOLICITACAO = v_req OR ITSM_ID_INCIDENTE = v_req)',
'              AND UPPER(ITSM_STATUS) IN (''RESOLVIDO'',''FECHADO'')',
'              FETCH FIRST 1 ROWS ONLY;',
'',
'            v_result := ''VERDE'';',
'        EXCEPTION',
'            WHEN NO_DATA_FOUND THEN',
'',
'                v_result := ''AMARELO''; -- aguardando carga',
'        END;',
'    END IF;',
'',
unistr('    -- 2) SGDS: sem restri\00E7\00E3o de tamanho ou de 4 a 6 caracteres'),
' /*   IF v_result = ''VERMELHO'' THEN',
'        BEGIN',
'            SELECT ''X''',
'            INTO v_dummy',
'            FROM CARGA.CAR_SGDS',
'            WHERE SGDS_NUMERO LIKE ''%'' || v_req || ''%''',
'            FETCH FIRST 1 ROWS ONLY;',
'',
'            v_result := ''VERDE'';',
'        EXCEPTION',
'            WHEN NO_DATA_FOUND THEN',
unistr('                NULL; -- SGDS n\00E3o existe  mant\00E9m vermelho'),
'        END;',
'    END IF;',
'*/',
unistr('    -- 3) OTRS:  16 caracteres + estado v\00E1lido'),
'    IF v_result = ''VERMELHO'' AND v_len = 16 THEN',
'        BEGIN',
'            SELECT ''X''',
'            INTO v_dummy',
'            FROM CARGA.CAR_OTRS',
'            WHERE OTRS_TICKET = v_req',
'              AND UPPER(OTRS_ESTADO) IN (''RESOLVIDO'',''FECHADO'')',
'              FETCH FIRST 1 ROWS ONLY;',
'',
'            v_result := ''VERDE'';',
'        EXCEPTION',
'            WHEN NO_DATA_FOUND THEN',
'',
'                    v_result := ''AMARELO''; --aguardando carga',
'                ',
'              ',
'        END;',
'    END IF;',
'',
'    -- Salva resultado no item',
'    APEX_UTIL.SET_SESSION_STATE(''P31_REQ_RESULTADO'', v_result);',
'END;',
''))
,p_attribute_02=>'P31_ESFO_NR_REQUISICAO'
,p_attribute_03=>'P31_REQ_RESULTADO'
,p_attribute_04=>'N'
,p_attribute_05=>'PLSQL'
,p_wait_for_result=>'Y'
);
