 p_id=>wwv_flow_imp.id(440752432933782461)
,p_plug_name=>'Preview'
,p_title=>'Preview'
,p_region_template_options=>'#DEFAULT#:t-Region--scrollBody'
,p_plug_template=>wwv_flow_imp.id(220964005915371759)
,p_plug_display_sequence=>50
,p_plug_item_display_point=>'BELOW'
,p_location=>null
,p_function_body_language=>'PLSQL'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'declare',
'    v_sql  varchar2(32767);',
'    v_ctx  apex_exec.t_context;',
'    v_cnt  pls_integer; -- quantidade de colunas',
'    v_cab varchar2(2000) := '''';',
'    --v_col  apex_exec.t_column; ',
'---------------',
'    v_clob CLOB;',
'    v_passo varchar2(20);',
'begin',
'    v_passo := ''Passo 1 - '';',
'   -- Conta a quantidade de colunas do arquivo origem',
'   select count(*)',
'     into v_cnt',
'     from apex_application_temp_files f,',
'          table ( apex_data_parser.get_columns(apex_data_parser.discover(',
'             p_content   => f.blob_content,',
'             p_file_name => f.filename',
'          )) ) c',
'    where f.name = :P32_ARQUIVO;',
'',
'    v_passo := ''Passo 2 - '';',
unistr('    -- Cria cabe\00E7alho din\00E2mico'),
'    for i in 1 .. v_cnt ',
'    loop',
'        v_cab := v_cab || '', p.col'' || to_char(i, ''FM000'');',
'    end loop;',
'',
'    v_passo := ''Passo 3 - '';',
'    -- Query principal',
'    v_sql := ''select p.line_number''',
'            || v_cab',
'            || q''[ from apex_application_temp_files f, ',
'                    table( apex_data_parser.parse(',
'                            p_content           => f.blob_content,',
'                            p_file_name         => f.filename,',
'                            p_file_type         => 1, --apex_data_parser.t_file_type.c_file_type_xlsx,',
'                            p_file_profile      => apex_data_loading.get_file_profile(p_static_id => :P32_SISTEMA),',
'                            p_max_rows          => 10 ) ) p',
'                  where f.name = :P32_ARQUIVO',
'                 order by 1]'';',
'    ',
'    v_passo := ''Passo 4 - '';',
'    -- Abre o contexto do query',
'    v_ctx := apex_exec.open_query_context(',
'                p_location  => apex_exec.c_location_local_db,',
'                p_sql_query => v_sql);    ',
'    ',
'    v_passo := ''Passo 5 - '';',
unistr('    -- Obt\00E9n o n\00FAmero de colunas'),
'    v_cnt := apex_exec.get_column_count(v_ctx);',
'    ',
'    v_passo := ''Passo 6 - '';',
unistr('    -- Gera o cabe\00E7alho da tabela utilizando a primeira linha'),
'    v_clob := ''<div class="t-Report-tableWrap">'';',
'    v_clob := v_clob || ''<table class="t-Report-report">'';',
'    v_clob := v_clob || ''<thead><tr>'';',
'    ',
'    v_passo := ''Passo 7 - '';',
'     -- Pega a primeira linha',
'    if apex_exec.next_row(v_ctx) ',
'    then',
'    --v_clob := v_clob || ''<th>Linha</th>'';',
'    for i in 1 .. v_cnt ',
'        loop',
'            v_clob := v_clob || ''<th class="t-Report-colHead">'' || apex_escape.html(apex_exec.get_varchar2(v_ctx, i)) || ''</th>'';',
'        end loop;',
'    end if;',
'',
'    v_clob :=  v_clob || ''</tr></thead><tbody>'';    ',
'',
'    v_passo := ''Passo 8 - '';',
'    -- Gera as linhas',
'    while apex_exec.next_row(v_ctx) ',
'    loop',
'        v_clob :=  v_clob || ''<tr>'';    ',
'        for i in 1 .. v_cnt ',
'        loop',
'            v_clob := v_clob || ''<td class="t-Report-cell">'' || apex_escape.html(apex_exec.get_varchar2(v_ctx, i)) || ''</td>'';',
'        end loop;',
'        v_clob :=  v_clob || ''</tr>'';    ',
'    end loop;',
'',
'    v_clob := v_clob || ''</tbody></table></div>'';',
'',
'    v_passo := ''Passo 9 - '';',
'    -- fecha o contexto',
'    apex_exec.close(v_ctx);',
'    ',
'    return v_clob;',
'   ',
'    exception',
'    when others then',
'        apex_exec.close(v_ctx);',
'        if SQLCODE = -20987 then',
'            return ''ERRO ao ler arquivo '' || SQLERRM;',
'        else',
'            raise;',
'        end if;        ',
'end;'))
,p_plug_source_type=>'NATIVE_DYNAMIC_CONTENT'
,p_plug_display_condition_type=>'EXPRESSION'
,p_plug_display_when_condition=>':P32_ARQUIVO IS NOT NULL and :P32_ERROR_ROW_COUNT IS NULL'
,p_plug_display_when_cond2=>'PLSQL'
,p_landmark_type=>'region'
,p_ai_enabled=>false
);
