wwv_flow_imp_page.create_page_process(
 p_id=>wwv_flow_imp.id(156219578060018156)
,p_process_sequence=>10
,p_process_point=>'AFTER_SUBMIT'
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'Data Load'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'    l_file blob;',
'    l_load_result apex_data_loading.t_data_load_result;',
'    v_tipo_sistema varchar2(60);',
'    --',
'    v_mes_planilha varchar2(30);',
'BEGIN',
'    -- Busca o tipo do sistema',
'    select DISPLAY_VALUE',
'    into v_tipo_sistema',
'     from APEX_APPLICATION_LOV_ENTRIES ',
'    where APPLICATION_ID = :APP_ID',
'      and LIST_OF_VALUES_NAME = ''TIPO_SISTEMA_CARGA''',
'      and RETURN_VALUE = :P32_SISTEMA;',
'',
'    -- Busca o arquivo para LOAD',
'    SELECT blob_content',
'      INTO l_file',
'      FROM apex_application_temp_files',
'    WHERE name = :P32_ARQUIVO;',
'',
unistr('    -- Para SGDS remove o m\00EAs corrente e insere '),
'    IF :P32_SISTEMA = ''dl_sgds'' then',
'        select col001',
'         into v_mes_planilha',
'            from table( ',
'              apex_data_parser.parse(',
'                  p_content     => l_file,',
'                  p_file_name   => :P32_NOME_ARQUIVO,',
'                  p_file_type   => 1,',
'                  p_skip_rows   => 1,',
'                  p_max_rows    => 2) ',
'                  );',
'        ',
'        delete from carga.car_sgds where SGDS_MES_ANO = v_mes_planilha;          ',
'    end if;',
'',
'    -- Realiza o LOAD',
'    l_load_result := apex_data_loading.load_data (',
'                       p_static_id    => :P32_SISTEMA,',
'                       p_data_to_load => l_file );',
'    ',
unistr('    -- Grava o hist\00F3rico de arquivos com sucesso'),
'    if (l_load_result.processed_rows - l_load_result.error_rows) > 0 then',
'        insert into CARGA.CAR_HISTORICO (HIST_NM_ARQUIVO, HIST_SISTEMA, HIST_LOGIN_INCLUSAO, HIST_DT_HR_CARGA)',
'            values (:P32_NOME_ARQUIVO, v_tipo_sistema, :APP_USER, sysdate);',
'    end if;',
'',
'    -- Controles',
'    :P32_ERROR_ROW_COUNT := l_load_result.error_rows;',
'',
'    :P32_MESSAGE := l_load_result.processed_rows || '' Linha(s) processada(s). '';',
'',
'    if l_load_result.error_rows > 0 then',
'        :P32_MESSAGE := :P32_MESSAGE || l_load_result.error_rows || '' Linha(s) com erro.'';',
'    end if;',
'END;'))
,p_process_clob_language=>'PLSQL'
,p_process_error_message=>unistr('N\00E3o foi poss\00EDvel efetuar a carga')
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_when_button_id=>wwv_flow_imp.id(156215385652018128)
,p_process_success_message=>'&P32_MESSAGE.'
,p_internal_uid=>74011496901317814
);
