,p_query_type=>'SQL'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'SELECT',
'    NVL(SUM(EXTRACT(HOUR FROM ESFO.ESFO_HORA)), 0) || ''h'' AS horas_consumidas,',
'    ''Horas Consumidas'' AS titulo',
'FROM',
'    CADASTRO.CAD_ESPECIFICACAO ESP',
'    INNER JOIN CADASTRO.CAD_ESPE_X_INSU ESXIN ON ESP.ESPE_SQ = ESXIN.ESXIN_ESPE_SQ',
'    INNER JOIN CADASTRO.CAD_INSUMO INSU ON ESXIN.ESXIN_INSU_SQ = INSU.INSU_SQ',
'    INNER JOIN CADASTRO.CAD_PERFIL_COLABORADOR PEXCO ON  ESXIN.ESXIN_SQ  = PEXCO.PEXCO_ESXIN_SQ',
'    INNER JOIN CADASTRO.CAD_COLB_X_FILI COXFI  ON PEXCO.PEXCO_COXFI_SQ   = COXFI.COXFI_SQ',
'    INNER JOIN CADASTRO.CAD_COLABORADOR COLB  ON COXFI.COXFI_COLB_SQ     = COLB.COLB_SQ',
'    LEFT  JOIN NEGOCIO.NEG_ESFORCO_FATURAMENTO ESFO ON ',
'          ESFO.ESFO_ESXIN_SQ = ESXIN.ESXIN_SQ',
'          AND ESFO.ESFO_COXFI_SQ = COXFI.COXFI_SQ',
'WHERE',
'    COLB.COLB_NOME = :APP_USER',
'    AND ESXIN.ESXIN_SQ = :P39_ESP',
'    AND ESFO_DATA BETWEEN TRUNC(SYSDATE, ''MM'') AND LAST_DAY(SYSDATE)',
'GROUP BY',
'    ESXIN.ESXIN_QTDE_HORAS_MES'))
,p_lazy_loading=>false
,p_plug_source_type=>'NATIVE_CARDS'
,p_ajax_items_to_submit=>'P39_ESP'
