,p_item_sequence=>10
,p_item_plug_id=>wwv_flow_imp.id(159032490937525289)
,p_prompt=>unistr('<div>       <h3 style="font-size: 15px; margin-top: -7px;">       <a href="#" style="color: #0070C0; text-decoration: none;">Requisi\00E7\00F5es</a>     </h3>   </div>')
,p_display_as=>'NATIVE_CHECKBOX'
,p_lov=>wwv_flow_string.join(wwv_flow_t_varchar2(
'SELECT DISTINCT',
'  ESFO_NR_REQUISICAO AS DISPLAY_VALUE,',
'  ESFO_NR_REQUISICAO AS RETURN_VALUE',
'FROM',
'    NEGOCIO.NEG_ESFORCO_FATURAMENTO ESFO',
'    INNER JOIN CADASTRO.CAD_COLB_X_FILI COXFI ON ESFO.ESFO_COXFI_SQ = COXFI.COXFI_SQ',
'    INNER JOIN CADASTRO.CAD_COLABORADOR COLB ON COXFI.COXFI_COLB_SQ = COLB.COLB_SQ',
'    INNER JOIN CADASTRO.CAD_CLIENTE_FILIAL CLIF ON COXFI.COXFI_CLIF_SQ = CLIF.CLIF_SQ',
'WHERE ',
'    COLB.COLB_NOME = :APP_USER',
'    AND ESFO.ESFO_DATA >= TRUNC(SYSDATE, ''MM'')',
'     AND ESFO.ESFO_DATA < ADD_MONTHS(TRUNC(SYSDATE, ''MM''), 1)'))
,p_field_template=>wwv_flow_imp.id(221035127794371831)
,p_item_template_options=>'#DEFAULT#'
,p_lov_display_extra=>'YES'
,p_attribute_01=>'3'
,p_multi_value_type=>'SEPARATED'
,p_multi_value_separator=>':'
);
