wwv_flow_imp_page.create_page_da_action(
 p_id=>wwv_flow_imp.id(160476896226438993)
,p_event_id=>wwv_flow_imp.id(160476384829438992)
,p_event_result=>'TRUE'
,p_action_sequence=>10
,p_execute_on_page_init=>'Y'
,p_action=>'NATIVE_SET_VALUE'
,p_affected_elements_type=>'ITEM'
,p_affected_elements=>'P39_ESFO_ESXCL_SQ,P39_ESFO_PERFIL,P39_ESFO_ESXIN_SQ'
,p_attribute_01=>'SQL_STATEMENT'
,p_attribute_03=>wwv_flow_string.join(wwv_flow_t_varchar2(
'SELECT',
'    ESP.ESPE_CD,',
'    COALESCE(ESXIN.ESXIN_CD_ALIAS, INSU.INSU_CD) || '' '' || INSU.INSU_DESC PERFIL,',
'    ESXIN.ESXIN_SQ',
'FROM',
'    CADASTRO.CAD_ESPECIFICACAO ESP',
'    INNER JOIN CADASTRO.CAD_ESPE_X_INSU ESXIN ON ESP.ESPE_SQ = ESXIN.ESXIN_ESPE_SQ',
'    INNER JOIN CADASTRO.CAD_INSUMO INSU ON ESXIN.ESXIN_INSU_SQ = INSU.INSU_SQ',
'    INNER JOIN CADASTRO.CAD_PERFIL_COLABORADOR PEXCO ON  ESXIN.ESXIN_SQ  = PEXCO.PEXCO_ESXIN_SQ',
'    INNER JOIN CADASTRO.CAD_COLB_X_FILI COXFI  ON PEXCO.PEXCO_COXFI_SQ   = COXFI.COXFI_SQ',
'    INNER JOIN CADASTRO.CAD_COLABORADOR COLB  ON COXFI.COXFI_COLB_SQ   = COLB.COLB_SQ',
