wwv_flow_imp_page.create_page_process(
 p_id=>wwv_flow_imp.id(162856157055636591)
,p_process_sequence=>30
,p_process_point=>'AFTER_SUBMIT'
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'Carga'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'declare',
'    v_blob_content blob;',
'    v_filename     varchar2(400);',
'    v_unid_sq      number;',
'    v_valor        number;',
'    v_tot_lin_proc number := 0;',
'',
'    -- lista de erros',
'    e_descricao_nula exception;',
'    e_unidade_nao_encontrada exception;',
'    e_erro_ao_converter_valor exception;',
'',
unistr('    -- Fun\00E7\00E3o para obter o c\00F3digo da unidade com base na descri\00E7\00E3o'),
'    function get_unid_sq (',
'        p_unid_cd in varchar2',
'    ) return number is',
'        v_unid_sq number;',
'    begin',
'        select unid_sq',
'          into v_unid_sq',
'          from cadastro.cad_unidade',
'         where upper(trim(unid_desc)) = upper(trim(p_unid_cd))',
'           and rownum = 1;',
'',
'        return v_unid_sq;',
'    exception',
'        when no_data_found then',
'            raise e_unidade_nao_encontrada;',
'    end;',
'',
unistr('    -- Fun\00E7\00E3o para converter string para n\00FAmero'),
'    function get_valor_to_number (',
'        p_valor in varchar2',
'    ) return number is',
'        v_num number;',
'        v_inverso varchar2(300);',
'    begin',
'        select reverse(p_valor)',
'            into v_inverso',
'        from dual;',
'',
'        if regexp_substr(',
'            v_inverso,',
'            ''[.,]''',
'        ) = ''.'' then',
'            v_num := to_number ( replace(',
'                p_valor,',
'                ''.'',',
'                '',''',
'            ) );',
'        else',
'            v_num := to_number ( p_valor );',
'        end if;',
'        return round(',
'            v_num,',
'            2',
'        );',
'    exception',
'        when others then',
'            raise e_erro_ao_converter_valor;',
'    end;',
'begin',
'    -- Obter o arquivo enviado',
'    select blob_content,',
'           filename',
'      into',
'        v_blob_content,',
'        v_filename',
'      from apex_application_temp_files a',
'     where name = :P42_ARQUIVO;',
'',
unistr('    -- Exclus\00E3o dos itens da tabela cadastro.cad_insumo'),
'    delete from cadastro.cad_insumo',
'     where insu_veta_sq = :P42_VETA_SQ;',
'',
'    -- Processamento do arquivo',
'    for i in (',
'        select p.line_number as line,',
'               p.col001 as codigo,',
'               p.col002 as descricao,',
'               p.col003 as unidade,',
'               p.col004 as valor',
'          from table ( apex_data_parser.parse(',
'            p_content         => v_blob_content,',
'            p_file_name       => v_filename,',
'            p_xlsx_sheet_name =>',
'                               case',
'                                   when :P42_TIPO_ARQUIVO = 1',
'                                      and :P42_XLSX_WORKSHEET is not null then',
'                                       :P42_XLSX_WORKSHEET',
'                               end,',
'            p_csv_enclosed    =>',
'                            case',
'                                when :P42_TIPO_ARQUIVO = 2 then',
'                                    ''"''',
'                            end,',
'            p_file_charset    =>',
'                            case',
'                                when :P42_TIPO_ARQUIVO = 2 then',
'                                    ''WE8ISO8859P1''',
'                                else',
'                                    ''AL32UTF8''',
'                            end,',
'            p_skip_rows       => 1',
'        ) ) p',
'    ) loop',
'        v_tot_lin_proc := v_tot_lin_proc + 1;  ',
'        begin',
'            if i.descricao is null then',
'                raise e_descricao_nula;',
'            end if;',
'',
unistr('            -- Obter o c\00F3digo da unidade'),
'            v_unid_sq := get_unid_sq(i.unidade);',
'            ',
unistr('            -- Converter o valor para n\00FAmero'),
'            v_valor := get_valor_to_number(i.valor);',
'            ',
'            -- Inserir o insumo',
'            insert into cadastro.cad_insumo (',
'                insu_sq,',
'                insu_cd,',
'                insu_desc,',
'                insu_unid_sq,',
'                insu_valor,',
'                insu_veta_sq',
'            ) values ( null,',
'                       i.codigo,',
'                       i.descricao,',
'                       v_unid_sq,',
'                       v_valor,',
'                       :P42_VETA_SQ );',
'        exception',
'            when e_descricao_nula then',
'                apex_collection.add_member(',
'                    p_collection_name => ''ERRO_CARGA_INSUMO'',',
unistr('                    p_c001            => ''Campo "Descri\00E7\00E3o" n\00E3o pode ser nulo.'','),
'                    p_n001            => i.line',
'                );',
'            when e_unidade_nao_encontrada then',
'                apex_collection.add_member(',
'                    p_collection_name => ''ERRO_CARGA_INSUMO'',',
'                    p_c001            => ''Unidade ''',
'                              || i.unidade',
unistr('                              || '' n\00E3o encontrada.'','),
'                    p_n001            => i.line',
'                );',
'            when e_erro_ao_converter_valor then',
'                apex_collection.add_member(',
'                    p_collection_name => ''ERRO_CARGA_INSUMO'',',
unistr('                    p_c001            => ''N\00E3o foi poss\00EDvel converter o valor "'''),
'                              || i.valor',
unistr('                              || ''" para n\00FAmero.'','),
'                    p_n001            => i.line',
'                );',
'            when others then',
'                apex_collection.add_member(',
'                    p_collection_name => ''ERRO_CARGA_INSUMO'',',
'                    p_c001            => sqlerrm,',
'                    p_n001            => i.line',
'                );',
'        end;',
'    end loop;',
'',
'    :P42_LINHAS_PROCESSADAS := v_tot_lin_proc;',
'end;'))
,p_process_clob_language=>'PLSQL'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_when_button_id=>wwv_flow_imp.id(162847855755636557)
,p_internal_uid=>80648075896936249
);
end;
